// Event Boot
client.on('messageReactionRemove', (messageReaction, user) => {
  let GuildMember = messageReaction.message.guild.members.get(user.id);

  Actions.storeValue(user.id, 1, 'rediEvent.MemberID', cache);
  Actions.storeValue(GuildMember, 1, 'rediEvent.Member', cache);

  Actions.storeValue(messageReaction, 1, 'rediEvent.ReactionObj', cache);

  Actions.callNextAction(cache);
});
